              label="Email"
              type="email"
              placeholder="john@gmail.com"
            />

            <Button title="Continue" onClick={nextStep} />
          </>
        )}

        {step === 2 && (
          <> 
          </>
        )}
      </div>

      <div />
    </div>
  );
};

export default Register;
